from typing import List
class Solution:
    def largestRectangleArea(self, heights: List[int]) -> int:
        N = len(heights)
        if N == 0:
            return 0
        stack = list()
        max_height = 0
        i = 0
        while i < N:
            #print(f'\ti, stack, max_height = {i}, {stack}, {max_height}')
            if not stack or heights[i] >= heights[stack[-1]]:
                # push index to stack if current height is larger than previous
                stack.append(i)
                i += 1
            else:
                # calculate max value
                p = stack.pop()
                h = heights[p]
                if not stack:
                    w = i
                else:
                    w = i - stack[-1] - 1
                #print(f'\t\th, w = {h}, {w}')
                max_height = max(max_height, h * w)
        while stack:
            #print(f'i, stack, max_height = {i}, {stack}, {max_height}')
            p = stack.pop()
            h = heights[p]
            if not stack:
                w = i
            else:
                w = i - stack[-1] - 1
            #print(f'\th, w = {h}, {w}')
            max_height = max(max_height, h * w)
        return max_height

